import { Routes, Route, BrowserRouter } from "react-router-dom";

function App() {
  return (
  <>
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Home />} />
      </Routes>
    </BrowserRouter>
  </>
  );
}

export default App;
